document.addEventListener('DOMContentLoaded', function() {
/* Add Code Here */
  const buttonElement = document.getElementById('addBtn');
  const todoListElement = document.getElementById('todoList');
  const inputElement = document.getElementById('input');
inputElement.value
  buttonElement.addEventListener('click', (en) => {
    const newDiv = document.createElement("div");
    newDiv.classList.add('todoItem')
    const newSpan = document.createElement('span')
    newSpan.classList.add('itemContent')
    newSpan.textContent = inputElement.value;
    const newButton = document.createElement('button')
    newButton.classList.add('deleteBtn')
    newButton.textContent = 'Delete'
    newDiv.appendChild(newSpan);
    newDiv.appendChild(newButton);
    todoListElement.append(newDiv);
  })

});

